import React from 'react'
import SignIn from '../../AuthFlow/SignIn/SignIn'
import LoginIn from '../../AuthFlow/LoginIn/LoginIn'
import ForgotPassword from '../../AuthFlow/ForgotPassword/ForgotPassword'
import Otp from '../../AuthFlow/OTP/Otp'
import main from '../../AppFlow/MainScreen/main'
import { BrowserRouter as Router, Routes, Route,} from 'react-router-dom'

const AppStack = () => {
    return(
            <Routes>
                <Route path='/' element={<main/>}/>
            </Routes>
    )
}

const AuthStack = () => {
    return(
            <Routes>
                <Route path='/auth/Signin' element={<SignIn/>}/>
                <Route path='/auth/Login' element={<LoginIn/>}/>
                <Route path='/auth/Forgotpasscode' element={<ForgotPassword/>}/>
                <Route path='/auth/Otp' element={<Otp/>}/>
            </Routes>
    )
}

const AppRouter = () => {
    const isAuthenticated = true
    return (
        <Router>
            <Routes>
            {isAuthenticated ? (
                    <Route exact path='/' element={<AppStack/>}/>
                ): 
                    <Route path='/auth' element={<AuthStack/>}/>
                }
            </Routes>
        </Router>
    )
}


export default AppRouter
